import React, { Component } from 'react';
import { Nav, Navbar, Row, Col } from 'react-bootstrap';
import Main from './routes/main';
import './App.css';

class App extends Component  {
    render() {
        return (  
            <div>
                <header>
                <Navbar collapseOnSelect expand="md"  style={{ background: 'url(http://www.getmdl.io/assets/demos/transparent.jpg) center / cover' }}>
                    <Navbar.Brand href="/" style={{ textDecoration: 'none' }}>My Portfolio Page</Navbar.Brand>

                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link href="/" className="link-name" style={{ textDecoration: 'none' }}>Homepage</Nav.Link>
                            <Nav.Link href="/about" className="link-name" style={{ textDecoration: 'none' }}>About</Nav.Link>
                            <Nav.Link href="/resume" className="link-name" style={{ textDecoration: 'none' }}>Resume</Nav.Link>
                            <Nav.Link href="/projects" className="link-name" style={{ textDecoration: 'none' }}>Projects</Nav.Link>
                            <Nav.Link href="/contact" className="link-name" style={{ textDecoration: 'none' }}>Contact</Nav.Link>
                        </Nav>                    
                    </Navbar.Collapse>
                </Navbar>

            </header>
            <div style={{ 
                        background: '#9CECFB',/* fallback for old browsers */ background: '-webkit-linear-gradient(to top, #0052D4, #65C7F7, #9CECFB)',/* Chrome 10-25, Safari 5.1-6 */ background: 'linear-gradient(to top, #0052D4, #65C7F7, #9CECFB)',/* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */ top: '0', left: '0', width: '100%', height: '100%' }} >
                <Main />
            </div>
            </div>

        );
    }
}    

export default App;

